import React, { useEffect, useState } from "react";

const App = () => {
    let [num , setNum] = useState(0);

    useEffect(()=>{
        alert('You Clicked');
    })

    return (
        <>
            <button 
            onClick={()=> setNum(num+1)}>Click {num}
            </button>
        </>
    )
}

export default App;
